                                        function gregorianToJalali(gy, gm, gd) {
                                          const g_d_m = [
                                            0,
                                            31,
                                            (gy % 4 === 0 && gy % 100 !== 0) ||
                                            gy % 400 === 0
                                              ? 29
                                              : 28,
                                            31,
                                            30,
                                            31,
                                            30,
                                            31,
                                            31,
                                            30,
                                            31,
                                            30,
                                            31
                                          ];

                                          let jy = gy <= 1600 ? 0 : 979;
                                          gy -= gy <= 1600 ? 621 : 1600;
                                          let gy2 = gm > 2 ? gy + 1 : gy;
                                          let days =
                                            365 * gy +
                                            Math.floor((gy2 + 3) / 4) -
                                            Math.floor((gy2 + 99) / 100) +
                                            Math.floor((gy2 + 399) / 400);
                                          for (let i = 0; i < gm; ++i)
                                            days += g_d_m[i];
                                          days += gd - 1;
                                          let j_day_no = days - 79;
                                          let j_np = Math.floor(
                                            j_day_no / 12053
                                          );
                                          j_day_no %= 12053;
                                          jy +=
                                            33 * j_np +
                                            4 * Math.floor(j_day_no / 1461);
                                          j_day_no %= 1461;
                                          if (j_day_no >= 366) {
                                            jy += Math.floor(
                                              (j_day_no - 1) / 365
                                            );
                                            j_day_no = (j_day_no - 1) % 365;
                                          }
                                          const jm_list = [
                                            0, 31, 31, 31, 31, 31, 31, 30, 30,
                                            30, 30, 30, 29
                                          ];

                                          let jm, jd;
                                          for (
                                            jm = 1;
                                            jm <= 12 && j_day_no >= jm_list[jm];
                                            ++jm
                                          ) {
                                            j_day_no -= jm_list[jm];
                                          }
                                          jd = j_day_no + 1;
                                          return [jy, jm, jd];
                                        }
